        else if(p.t==5 & p.bits==254){
            fixedMDS = fixedMDS254_5
            fixedRoundConst = fixedRoundConst254_5
        }
        else if(p.t==3 & p.bits==255){
            fixedMDS = fixedMDS255_3
            fixedRoundConst = fixedRoundConst255_3
        }
        else if(p.t==5 & p.bits==255){
            fixedMDS = fixedMDS255_5
            fixedRoundConst = fixedRoundConst255_5
        }
        
        p.bits match{
            case 254 => prime = prime254
            case 255 => prime = prime255
        }
        //Add Round Constants
        for(i <- 0 until p.t){
            workVec(i) = stateVec(i)+ fixedRoundConst(i+index)
        }
        
        //S-box layer
        if(isFullRound){
            workVec = workVec.map(i => Seq.fill(p.alpha)(i).reduce(_*_) % prime)
        }
        else{
            workVec = workVec.map(i => if( i == workVec.head) Seq.fill(p.alpha)(i).reduce(_*_) % prime else i)
        }
        
        //Mix
        val newStateVec = matMul(p, fixedMDS, (0 until p.t) map (i => Seq.fill(1)(workVec(i))))

        newStateVec
    }

    //Taken helper functions from HW4 and 
    //modified matMul to return proper output format
    def grabCol(m: Seq[Seq[BigInt]], i: Int) = m map { _(i) }

    def dotP(p: PoseidonParams,a: Seq[BigInt], b: Seq[BigInt]) = {
        var prime = prime254
        p.bits match{
            case 254 => prime = prime254
            case 255 => prime = prime255
        }
        a.zip(b).map{ case (x,y) => (x * y) }.sum % prime
    }
    
    def matMul(p: PoseidonParams, a: Seq[Seq[BigInt]], b: Seq[Seq[BigInt]]): ArrayBuffer[BigInt] = {
        val mtx_prod: Seq[Seq[BigInt]] = Seq.tabulate(a.size, b.head.size){ case (i,j) => dotP(p, a(i), grabCol(b,j)) }

        var ret_val = (new ArrayBuffer[BigInt]) ++ Seq.fill(p.t)(BigInt(0))             
        (0 until p.t).foreach(i => ret_val(i) = mtx_prod(i)(0))

        val newStateVec = (new ArrayBuffer[BigInt]) ++ Seq.fill(p.t)(BigInt(0))
        (0 until p.t).foreach(i => newStateVec(i) = ret_val(i))
        newStateVec
    }
}

